import React from "react";
import styled from "styled-components";

const Section = styled.section`
  min-height: 100vh;
  width: 100vw;
  background-color: ${(props) => props.theme.body};
  position: relative;
`;

const Title = styled.h2`
  font-size: ${(props) => props.theme.fontxl};
  text-transform: capitalize;
  color: ${(props) => props.theme.text};
  display: flex;
  justify-content: center;
  align-items: center;
  margin: 1rem auto;
`;

const Container = styled.div`
  width: 75%;
  margin: 2rem auto;
  display: flex;
  justify-content: space-around;
  align-items: center;
  flex-wrap: wrap;
`

const MemberComponent = ({img, name = " ", postMessage = " "}) => {
  return(
    <Item>
      <ImageContainer>
        <img src="" alt={name} />
      </ImageContainer>
    </Item>
  )
}

const Team = () => {
  return(
    <Section>
      <Title>
        Team
      </Title>
      <Container>
        <div>Team 1</div>
        <div>Team 2</div>
        <div>Team 3</div>
        <div>Team 4</div>
      </Container>
    </Section>
  ) 
}

export default Team;
